import React,{useContext} from 'react';

import {changeProductType} from '../Redux/Reducer'

const Data =()=>{
    const {products}  = useContext(changeProductType);
    if(products === 'home') {
        return home;
    }
    return null;
}

export default Data;

const home = [
    {
        image:1
    }
]
